Verenigde Staten
Actie / Avontuur
115 minuten

goed

met Chris Hemsworth, Natalie Portman en Anthony Hopkins

De machtige, maar arrogante krijger Thor (Hemsworth) wakkert met zijn roekeloze acties een eeuwenoude oorlog aan. Thors vader 
Odin (Hopkins) verbant Thor naar de Aarde en hier wordt hij gedwongen tussen de normale bevolking te leven. Hij wordt verliefd 
op de jonge wetenschapper Jane (Portman). Terwijl zij een relatie ontwikkelen op Aarde beseft Thor wat het vergt om een echte 
held te zijn wanneer zijn aartsvijand duistere krachten van Asgard naar de Aarde stuurt.
